import { useQuery } from "react-query";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
import { toast } from "react-hot-toast";
import { useTheme } from "styled-components";
import {
  PieChart,
  Pie,
  Cell,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import LoadingSpinner from "../components/common/LoadingSpinner";
import EmptyState from "../components/common/EmptyState";
import { MailWarning } from "lucide-react";

const AnalyticsContainer = styled.div`
  padding: 2rem;
`;

const Title = styled.h1`
  font-size: 2rem;
  color: ${({ theme }) => theme.colors.textPrimary};
  margin-bottom: 2rem;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 2rem;
`;

const Card = styled.div`
  background: ${({ theme }) => theme.colors.surface};
  border: 1px solid ${({ theme }) => theme.colors.border};
  border-radius: ${({ theme }) => theme.borderRadius.lg};
  padding: 2rem;
  box-shadow: ${({ theme }) => theme.boxShadow.lg};
`;

const CardTitle = styled.h2`
  font-size: 1.25rem;
  color: ${({ theme }) => theme.colors.textSecondary};
  margin-bottom: 1rem;
`;

const TotalEmailsValue = styled.div`
  font-size: 3rem;
  font-weight: bold;
  color: ${({ theme }) => theme.colors.primary};
`;

const Analytics = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const { logout } = useAuth();
  const {
    data: emails,
    isLoading,
    error,
  } = useQuery(
    "emails",
    async () => {
      const token = localStorage.getItem("token");
      if (!token) {
        navigate("/login");
        return;
      }
      const config = { headers: { Authorization: `Bearer ${token}` } };
      const { data } = await axios.get("/api/emails", config);
      return data;
    },
    {
      onError: (error) => {
        if (error.response && error.response.status === 401) {
          toast.error("Your session has expired. Please log in again.");
          logout();
          navigate("/login");
        }
      },
    },
  );

  if (isLoading) {
    return <LoadingSpinner text="Analyzing your emails..." />;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  if (!emails || emails.length === 0) {
    return (
      <EmptyState
        icon={<MailWarning />}
        title="No Email Data"
        description="We couldn't find any email data to analyze. Connect your account and classify some emails first."
      />
    );
  }

  const totalEmails = emails.length;
  const categoryCounts = emails.reduce((acc, email) => {
    acc[email.category] = (acc[email.category] || 0) + 1;
    return acc;
  }, {});

  const chartData = Object.entries(categoryCounts).map(([name, value]) => ({
    name,
    value,
  }));
  const COLORS = Object.values(theme.colors.chart);

  return (
    <AnalyticsContainer>
      <Title>Email Analytics</Title>
      <StatsGrid>
        <Card>
          <CardTitle>Total Emails Scanned</CardTitle>
          <TotalEmailsValue>{totalEmails}</TotalEmailsValue>
        </Card>
        <Card>
          <CardTitle>Category Distribution</CardTitle>
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie
                data={chartData}
                cx="50%"
                cy="50%"
                labelLine={false}
                outerRadius={80}
                fill="#8884d8"
                dataKey="value"
                label={({
                  cx,
                  cy,
                  midAngle,
                  innerRadius,
                  outerRadius,
                  percent,
                  index,
                }) => {
                  const radius =
                    innerRadius + (outerRadius - innerRadius) * 0.5;
                  const x = cx + radius * Math.cos(-midAngle * (Math.PI / 180));
                  const y = cy + radius * Math.sin(-midAngle * (Math.PI / 180));
                  return (
                    <text
                      x={x}
                      y={y}
                      fill="white"
                      textAnchor={x > cx ? "start" : "end"}
                      dominantBaseline="central"
                    >
                      {`${(percent * 100).toFixed(0)}%`}
                    </text>
                  );
                }}
              >
                {chartData.map((entry, index) => (
                  <Cell
                    key={`cell-${index}`}
                    fill={COLORS[index % COLORS.length]}
                  />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </Card>
      </StatsGrid>
    </AnalyticsContainer>
  );
};

export default Analytics;
